    "abx-plugin-pip",
    "abx-plugin-playwright",
    "abx-plugin-pocket",
    "abx-plugin-puppeteer",
    "abx-plugin-readability",
    "abx-plugin-readwise",
    "abx-plugin-ripgrep-search",
    "abx-plugin-singlefile",
    "abx-plugin-sonic-search",
    "abx-plugin-sqlitefts-search",
    "abx-plugin-title",
    "abx-plugin-wget",
    "abx-plugin-ytdlp",
    "abx-spec-abx-pkg",
    "abx-spec-archivebox",
    "abx-spec-config",
    "abx-spec-django",
    "abx-spec-extractor",
    "abx-spec-searchbackend",
    "archivebox",
]

